import { Route, Routes, Navigate } from "react-router-dom";
import GetStarted from "./Pages/GetStarted";
import SignIn from "./Pages/SignIn";
import SignUp from "./Pages/SignUp";
import Preferences from "./Pages/Preferences";
import ProfileSettings from "./Pages/ProfileSettings";
import DashRegular from "./Pages/DashRegular";

function App() {

  const filteredData = [
    { name: 'Meezan Bank Ltd', symbol: 'MEZN', date: '797,022', category: 'Banking' },
    { name: 'Amazon.com, Inc', symbol: 'AMZN', date: '37,020', category: 'Technology' },
    { name: 'Pakistan Stock Exchange', symbol: 'PSX', date: '48,354', category: 'Stocks' },
    { name: 'Hab', symbol: 'MEZN', date: '797,022', category: 'Banking' },
    { name: 'Amazon.com, Inc', symbol: 'AMZN', date: '37,020', category: 'Technology' },
  ];

  return (
    <Routes>
      <Route path="/getstarted" element={<GetStarted />} />
      <Route path="/signin" element={<SignIn />} />
      <Route path="/signup" element={<SignUp />} />
      <Route path="/preferences" element={<Preferences />} />
      <Route path="/profilesettings" element={<ProfileSettings />} />
      <Route path="/dashregular" element={<DashRegular filteredData={filteredData} />} />


      <Route path="/" element={<Navigate to="/dashregular" />} />
    </Routes>

  );
}

export default App;
